import React, {Component} from 'react'
import Typography from "@material-ui/core/Typography";
import Header from "../_layouts/_includes/header/Header";
import Content from "../_layouts/_includes/content/Content";
import Footer from "../_layouts/_includes/footer/Footer";



class ShowcaseContainer extends Component {

    constructor(props) {
        super(props)
        this.state = {}
    }

    render() {
        return (
            <>
                <Header user/>

                <Content>
                    <div>
                        <Typography variant="h5" gutterBottom>Витрина композиции</Typography>
                    </div>

                    <Footer/>
                </Content>
            </>
        )
    }
}

export default ShowcaseContainer
